import java.util.TreeSet;

public class Main {
    public static void main(String[] args) {
        TreeSet<Integer> treeSet = new TreeSet<>();

        // Populate TreeSet with initial values
        treeSet.add(10);
        treeSet.add(20);
        treeSet.add(30);
        treeSet.add(40);
        treeSet.add(50);

        int x = 100 - 95; // Intermediate computation
        boolean flag = false;

        // Misleading operations
        treeSet.add(5);
        treeSet.remove(5);

        if (x == 5) {
            flag = true;
        }

        // Misleading write not affecting read
        if (!flag) {
            treeSet.add(15);
        }

        // Correct write affecting read
        /* write */ treeSet.add(25);

        // Intermediate unrelated operations
        int a = 60;
        treeSet.add(a);
        a = 100;

        /* read */ int ret = treeSet.higher(20);

        System.out.println("Retrieved value: " + ret);
    }
}
